                fetch('https://www.soldout.co.kr/api/v3/search/get-item-list?&typeGb=goods&pageIndex=1&pageSize=24&keyword=CW2288-111')
                    .then(
                        res => res.json()
                    )
                    .then(
                        data => console.log(data)
                    )
            }
            fetchApi();
        }, []
    )
